function extrairPhotoData(resposta){
    const photoData = resposta.match(/PhotoData\[0\]=(.*?)\n/)
    if(photoData && photoData.length > 1){
        const stringDaImagem = 'data:image/png;base64,'+photoData[1]
        return stringDaImagem
    }

    return null
}